// HasInstance applies the HasEdge predicate on the "instance" edge.
func HasInstance() predicate.VirtualInterface {
	return predicate.VirtualInterface(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, InstanceTable, InstanceColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.ServiceInstance
		step.Edge.Schema = schemaConfig.VirtualInterface
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasInstanceWith applies the HasEdge predicate on the "instance" edge with a given conditions (other predicates).
func HasInstanceWith(preds ...predicate.ServiceInstance) predicate.VirtualInterface {
	return predicate.VirtualInterface(func(s *sql.Selector) {
		step := newInstanceStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.ServiceInstance
		step.Edge.Schema = schemaConfig.VirtualInterface
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

